// src/components/Footer.js
import React from 'react';
import styled from 'styled-components';

const FooterSection = styled.footer`
  background: #0d2538;
  color: #fff;
  padding: 20px;
  text-align: center;
`;

function Footer() {
  return (
    <FooterSection>
      &copy; {new Date().getFullYear()} MyWebsite. All rights reserved.
    </FooterSection>
  );
}

export default Footer;
